import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ isAuthenticated, onLogout }) => (
  <nav className="bg-gradient-to-r from-yellow-400 via-red-400 to-pink-500 text-white px-6 py-4 flex justify-between items-center shadow-lg rounded-b-2xl animate-fadeIn">
    <Link to="/" className="text-2xl font-extrabold tracking-wide drop-shadow-lg hover:text-yellow-100 transition-colors duration-200">Food Delivery</Link>
    <div className="flex gap-4 items-center">
      <Link to="/products" className="px-3 py-2 rounded-xl hover:bg-yellow-500 hover:text-white transition-all duration-200 font-semibold">Products</Link>
      <Link to="/cart" className="px-3 py-2 rounded-xl hover:bg-yellow-500 hover:text-white transition-all duration-200 font-semibold">Cart</Link>
      <Link to="/orders" className="px-3 py-2 rounded-xl hover:bg-yellow-500 hover:text-white transition-all duration-200 font-semibold">Orders</Link>
      {isAuthenticated ? (
        <>
          <Link to="/profile" className="px-3 py-2 rounded-xl hover:bg-yellow-500 hover:text-white transition-all duration-200 font-semibold">Profile</Link>
          <button onClick={onLogout} className="ml-2 px-4 py-2 bg-red-500 rounded-xl shadow hover:bg-red-700 transition-all duration-200 font-semibold">Logout</button>
        </>
      ) : (
        <>
          <Link to="/login" className="px-3 py-2 rounded-xl hover:bg-yellow-500 hover:text-white transition-all duration-200 font-semibold">Login</Link>
          <Link to="/signup" className="px-3 py-2 rounded-xl hover:bg-yellow-500 hover:text-white transition-all duration-200 font-semibold">Signup</Link>
        </>
      )}
    </div>
  </nav>
);

export default Navbar;
